import React from "react";
import styled from "styled-components";
import { Chapeau } from "../styled/typos";
const strategicComite = props => {
  return props.dataMember.map(member => {
    return (
      <div>
        <Chapeau>{member.name}</Chapeau>
        <Chapeau>{member.status}</Chapeau>
      </div>
    );
  });
};

export default strategicComite;

const Flex = styled.div`
  display: flex;
`;
